CREATE TABLE IF NOT EXISTS joblist (
    `Job_Name` VARCHAR(28) CHARACTER SET utf8,
    `Skills_Required` VARCHAR(19) CHARACTER SET utf8,
    `Interests` VARCHAR(14) CHARACTER SET utf8,
    `Education` VARCHAR(14) CHARACTER SET utf8,
    `Degree` VARCHAR(22) CHARACTER SET utf8,
    `Work_Experience` VARCHAR(14) CHARACTER SET utf8,
    `Schools` VARCHAR(37) CHARACTER SET utf8,
    `Companies` VARCHAR(15) CHARACTER SET utf8,
    `years_to_be_employed` INT,
    `Demand` VARCHAR(2) CHARACTER SET utf8
);
